import React from 'react'
import '../../sass/Definitions.scss'


export const EmpathyMap = () => {

    return (
        <div className="def-wrapper EmpathyMap">
            <h1>What is <u>Empathy Map</u> ?</h1>
            <img src='../../images/m3/empathy.png' />
            <span><h1>Definition: </h1>Customer empathy means walking the same path your customers are taking: living their pain, feeling their needs, and deeply understanding the solutions that will work. That's why the best products are often built by people who are creating solutions for their own challenges.</span>
            <span className='note'>Now,let's learn how to create an empathy map!</span>
        </div>
    )
}
